/*Table structure for table `product` */

DROP TABLE IF EXISTS `product`;

CREATE TABLE `product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` tinytext DEFAULT NULL,
  `price` tinytext DEFAULT NULL,
  `size` tinytext DEFAULT NULL,
  `type` tinytext DEFAULT NULL,
  `salePrice` tinytext DEFAULT NULL,
  `discount` tinytext DEFAULT NULL,
  `shortDetails` text DEFAULT NULL,
  `description` text DEFAULT NULL,
  `stock` tinytext DEFAULT NULL,
  `brand` tinytext DEFAULT NULL,
  `newPro` tinyint(1) DEFAULT 1,
  `sale` tinyint(1) DEFAULT 1,
  `smallImg1` tinyint(4) DEFAULT NULL,
  `smallImg2` tinyint(4) DEFAULT NULL,
  `smallImg3` tinyint(4) DEFAULT NULL,
  `bigImg` tinyint(4) DEFAULT NULL,
  `createdAt` tinyint(4) DEFAULT NULL,
  `updatedAt` tinyint(4) DEFAULT NULL,
  `isAmazoneOrFlipcart` tinyint(1) DEFAULT 0,
  `amazoneLink` text DEFAULT NULL,
  `flipCartLink` text DEFAULT NULL,
  PRIMARY KEY (`id`)
